import View from '../../components/View/View'
import { useSelector } from "react-redux";

const ViewPoke = () => {

    const { aPokemon } = useSelector(state => state);

    console.log(aPokemon);
    return (
        <div>
            <h1>detalle pornombre</h1>
            {
            aPokemon.map(aPoke => {
                return < View
                    key={aPoke.id}
                    nombre={aPoke.nombre}
                    imagen={aPoke.imagen}
                    vida={aPoke.vida}
                    ataque={aPoke.ataque}
                    defensa={aPoke.defensa}
                    velocidad={aPoke.velocidad}
                    altura={aPoke.altura}
                    peso={aPoke.peso}
                    id={aPoke.id}
                    types={aPoke.types} />
            })
        }
        </div>

    )
}

export default ViewPoke;
